import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route
            path="/wild_rose_tickets"
            exact
            component={FirstPageComponent}
          />
          <Route path="/login" exact component={LoginComponent} />
        </Switch>
      </div>
    </Router>
  );
}

export default App;
